import PlaceItem from "./PlaceItem";


export default ({markers}) => {
    console.log(markers)
    return(
        <div>
        {markers.map((marker)=>(
            <PlaceItem markerInfo={marker}key={marker._id}/>
          ))
        }
        </div>
    )

}
